import React, { Component } from 'react';

export default class NameWindow extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            names:['will','john','bob','rick']
        }
        this.addName = this.addName.bind(this);


    }

    addName(){
        return(
            <button className="nameInfoBtn">{this.state.names}</button>
        )

    }

    render(){
        return(
            <div className="btn-wrap">
                <button className="addNameBtn" onClick={this.addName}>Add Name</button>
            </div>
        )
    }
}
